export const GetALl = (req, res) =>{
    mysqlconnection.query('SELECT * FROM roles where state = 1 ORDER BY id DESC',(err, rows, fields) =>{
        if(!err){
            res.json(rows);
        }
        else{
            res.json(err);
        }
